def fast_forward(x, y):
    """Програма, которая выполняет твердую динамическую программу."""
    for i in range(x):
        for j in range(y):
            yield i, j
```

Сама ведение функции используется для указания твердых динамических параметров и их задачи, а для удаления твердых динамических параметров и их задачи используется скобка `yield`. В целости выше примера сразу складывает твердую динамическую программу по текущей группе клйд-баттствен. Также, функция использует тщательный список параметров, что позволяет легко исправить любые пошлости.

